	std::vector<InstrInfo*> InstrInfos::AllInfos = ReadInfos();

	std::string InstrInfos::AddSuffix(const std::string& s, std::vector<char>& ca)
	{
		return ca[0] == '\0' ? s : (s + std::string(ca));
	}

	std::string InstrInfos::AddPrefix(const std::string& s, std::vector<char>& ca)
	{
		return (std::string(ca) + s);
	}

	std::vector<InstrInfo*> InstrInfos::ReadInfos()
	{
		auto reader = DataReader(GetSerializedInstrInfos());
		auto infos = std::vector<InstrInfo*>(IcedConstants::CodeEnumCount);
		auto strings = FormatterStringsTable::GetStringsTable();
		auto ca = std::vector<char>(1);
		std::string s, s2, s3, s4, s5, s6;
		std::uint32_t v, v2, v3;
		std::int32_t prevIndex = -1;
		for (std::int32_t i = 0; i < infos.size(); i++)
		{
			std::uint8_t f = reader.ReadByte();
			auto ctorKind = static_cast<CtorKind>(f & 0x7F);
			std::int32_t currentIndex;
			if (ctorKind == CtorKind::Previous)
			{
				currentIndex = reader.GetIndex();
				reader.SetIndex(prevIndex);
				ctorKind = static_cast<CtorKind>(reader.ReadByte() & 0x7F);
			}
			else
			{
				currentIndex = -1;
				prevIndex = reader.GetIndex() - 1;
			}
			s = strings[reader.ReadCompressedUInt32()];
			if ((f & 0x80) != 0)
			{
				ca[0] = 'v';
				s = AddPrefix(s, ca);
			}
			InstrInfo* instrInfo;
			switch (ctorKind)
			{
			case CtorKind::Normal_1:
				instrInfo = new SimpleInstrInfo(s);
				break;
			case CtorKind::Normal_2a:
				ca[0] = static_cast<char>(reader.ReadByte());
				s2 = AddSuffix(s, ca);
				instrInfo = new SimpleInstrInfo(s, s2);
				break;
			case CtorKind::Normal_2b:
				v = reader.ReadCompressedUInt32();
				instrInfo = new SimpleInstrInfo(s, static_cast<InstrOpInfoFlags>(v));
				break;
			case CtorKind::Normal_2c:
				ca[0] = static_cast<char>(reader.ReadByte());
				s = AddSuffix(s, ca);
				instrInfo = new SimpleInstrInfo(s);
				break;
			case CtorKind::Normal_3:
				ca[0] = static_cast<char>(reader.ReadByte());
				s2 = AddSuffix(s, ca);
				v = reader.ReadCompressedUInt32();
				instrInfo = new SimpleInstrInfo(s, s2, static_cast<InstrOpInfoFlags>(v));
				break;
			case CtorKind::AamAad:
				instrInfo = new SimpleInstrInfo_AamAad(s);
				break;
			case CtorKind::asz:
				v = reader.ReadCompressedUInt32();
				instrInfo = new SimpleInstrInfo_as(static_cast<std::int32_t>(v), s);
				break;
			case CtorKind::bnd:
				ca[0] = static_cast<char>(reader.ReadByte());
				s2 = AddSuffix(s, ca);
				v = reader.ReadCompressedUInt32();
				instrInfo = new SimpleInstrInfo_bnd(s, s2, static_cast<InstrOpInfoFlags>(v));
				break;
			case CtorKind::DeclareData:
				instrInfo = new SimpleInstrInfo_DeclareData(static_cast<Code>(i), s);
				break;
			case CtorKind::er_2:
				v = reader.ReadCompressedUInt32();
				instrInfo = new SimpleInstrInfo_er(static_cast<std::int32_t>(v), s);
				break;
			case CtorKind::er_4:
				ca[0] = static_cast<char>(reader.ReadByte());
				s2 = AddSuffix(s, ca);
				v = reader.ReadCompressedUInt32();
				v2 = reader.ReadCompressedUInt32();
				instrInfo = new SimpleInstrInfo_er(static_cast<std::int32_t>(v), s, s2, static_cast<InstrOpInfoFlags>(v2));
				break;
			case CtorKind::far:
				ca[0] = static_cast<char>(reader.ReadByte());
				s2 = AddSuffix(s, ca);
				v = reader.ReadCompressedUInt32();
				instrInfo = new SimpleInstrInfo_far(static_cast<std::int32_t>(v), s, s2);
				break;
			case CtorKind::imul:
				ca[0] = static_cast<char>(reader.ReadByte());
				s2 = AddSuffix(s, ca);
				instrInfo = new SimpleInstrInfo_imul(s, s2);
				break;
			case CtorKind::maskmovq:
				instrInfo = new SimpleInstrInfo_maskmovq(s);
				break;
			case CtorKind::movabs:
				ca[0] = static_cast<char>(reader.ReadByte());
				s2 = AddSuffix(s, ca);
				s3 = strings[reader.ReadCompressedUInt32()];
				s4 = AddSuffix(s3, ca);
				instrInfo = new SimpleInstrInfo_movabs(s, s2, s3, s4);
				break;
			case CtorKind::nop:
				v = reader.ReadCompressedUInt32();
				v2 = reader.ReadByte();
				instrInfo = new SimpleInstrInfo_nop(static_cast<std::int32_t>(v), s, static_cast<Register>(v2));
				break;
			case CtorKind::OpSize:
				v = reader.ReadByte();
				s2 = (s + "w");
				s3 = (s + "l");
				s4 = (s + "q");
				instrInfo = new SimpleInstrInfo_OpSize(static_cast<CodeSize>(v), s, s2, s3, s4);
				break;
			case CtorKind::OpSize2_bnd:
				s2 = strings[reader.ReadCompressedUInt32()];
				s3 = strings[reader.ReadCompressedUInt32()];
				s4 = strings[reader.ReadCompressedUInt32()];
				instrInfo = new SimpleInstrInfo_OpSize2_bnd(s, s2, s3, s4);
				break;
			case CtorKind::OpSize3:
				ca[0] = static_cast<char>(reader.ReadByte());
				s2 = AddSuffix(s, ca);
				v = reader.ReadCompressedUInt32();
				instrInfo = new SimpleInstrInfo_OpSize3(static_cast<std::int32_t>(v), s, s2);
				break;
			case CtorKind::os:
				v = reader.ReadCompressedUInt32();
				v2 = reader.ReadByte();
				if (v2 > 1)
				{
					throw InvalidOperationException();
				}
				v3 = reader.ReadCompressedUInt32();
				instrInfo = new SimpleInstrInfo_os(static_cast<std::int32_t>(v), s, v2 != 0, static_cast<InstrOpInfoFlags>(v3));
				break;
			case CtorKind::CC_1:
				ca[0] = static_cast<char>(reader.ReadByte());
				s2 = AddSuffix(s, ca);
				v = reader.ReadCompressedUInt32();
				instrInfo = new SimpleInstrInfo_cc(static_cast<std::int32_t>(v), { s }, std::vector<std::string> {s2});
				break;
			case CtorKind::CC_2:
				s2 = strings[reader.ReadCompressedUInt32()];
				ca[0] = static_cast<char>(reader.ReadByte());
				v = reader.ReadCompressedUInt32();
				s3 = AddSuffix(s, ca);
				s4 = AddSuffix(s2, ca);
				instrInfo = new SimpleInstrInfo_cc(static_cast<std::int32_t>(v), { s, s2 }, std::vector<std::string> {s3, s4});
				break;
			case CtorKind::CC_3:
				s2 = strings[reader.ReadCompressedUInt32()];
				s3 = strings[reader.ReadCompressedUInt32()];
				ca[0] = static_cast<char>(reader.ReadByte());
				v = reader.ReadCompressedUInt32();
				s4 = AddSuffix(s, ca);
				s5 = AddSuffix(s2, ca);
				s6 = AddSuffix(s3, ca);
				instrInfo = new SimpleInstrInfo_cc(static_cast<std::int32_t>(v), { s, s2, s3 }, std::vector<std::string> {s4, s5, s6});
				break;
			case CtorKind::os_jcc_1:
				v2 = reader.ReadCompressedUInt32();
				v = reader.ReadCompressedUInt32();
				instrInfo = new SimpleInstrInfo_os_jcc(static_cast<std::int32_t>(v), static_cast<std::int32_t>(v2), std::vector<std::string> {s});
				break;
			case CtorKind::os_jcc_2:
				s2 = strings[reader.ReadCompressedUInt32()];
				v2 = reader.ReadCompressedUInt32();
				v = reader.ReadCompressedUInt32();
				instrInfo = new SimpleInstrInfo_os_jcc(static_cast<std::int32_t>(v), static_cast<std::int32_t>(v2), std::vector<std::string> {s, s2});
				break;
			case CtorKind::os_jcc_3:
				s2 = strings[reader.ReadCompressedUInt32()];
				s3 = strings[reader.ReadCompressedUInt32()];
				v2 = reader.ReadCompressedUInt32();
				v = reader.ReadCompressedUInt32();
				instrInfo = new SimpleInstrInfo_os_jcc(static_cast<std::int32_t>(v), static_cast<std::int32_t>(v2), std::vector<std::string> {s, s2, s3});
				break;
			case CtorKind::os_loopcc:
				s2 = strings[reader.ReadCompressedUInt32()];
				ca[0] = static_cast<char>(reader.ReadByte());
				s3 = AddSuffix(s, ca);
				s4 = AddSuffix(s2, ca);
				v3 = reader.ReadCompressedUInt32();
				v = reader.ReadCompressedUInt32();
				v2 = reader.ReadCompressedUInt32();
				instrInfo = new SimpleInstrInfo_os_loop(static_cast<std::int32_t>(v), static_cast<std::int32_t>(v2), static_cast<std::int32_t>(v3), { s, s2 }, std::vector<std::string> {s3, s4});
				break;
			case CtorKind::os_loop:
				ca[0] = static_cast<char>(reader.ReadByte());
				s2 = AddSuffix(s, ca);
				v = reader.ReadCompressedUInt32();
				v2 = reader.ReadCompressedUInt32();
				instrInfo = new SimpleInstrInfo_os_loop(static_cast<std::int32_t>(v), static_cast<std::int32_t>(v2), -1, { s }, std::vector<std::string> {s2});
				break;
			case CtorKind::os_mem:
				ca[0] = static_cast<char>(reader.ReadByte());
				s2 = AddSuffix(s, ca);
				v = reader.ReadCompressedUInt32();
				instrInfo = new SimpleInstrInfo_os_mem(static_cast<std::int32_t>(v), s, s2);
				break;
			case CtorKind::Reg16:
				ca[0] = 'w';
				s2 = AddSuffix(s, ca);
				instrInfo = new SimpleInstrInfo_Reg16(s, s2);
				break;
			case CtorKind::os_mem2:
				ca[0] = static_cast<char>(reader.ReadByte());
				s2 = AddSuffix(s, ca);
				v = reader.ReadCompressedUInt32();
				instrInfo = new SimpleInstrInfo_os_mem2(static_cast<std::int32_t>(v), s, s2);
				break;
			case CtorKind::os2_3:
				ca[0] = static_cast<char>(reader.ReadByte());
				s2 = AddSuffix(s, ca);
				v = reader.ReadCompressedUInt32();
				v2 = reader.ReadByte();
				if (v2 > 1)
				{
					throw InvalidOperationException();
				}
				instrInfo = new SimpleInstrInfo_os2(static_cast<std::int32_t>(v), s, s2, v2 != 0, InstrOpInfoFlags::None);
				break;
			case CtorKind::os2_4:
				ca[0] = static_cast<char>(reader.ReadByte());
				s2 = AddSuffix(s, ca);
				v = reader.ReadCompressedUInt32();
				v2 = reader.ReadByte();
				if (v2 > 1)
				{
					throw InvalidOperationException();
				}
				v3 = reader.ReadCompressedUInt32();
				instrInfo = new SimpleInstrInfo_os2(static_cast<std::int32_t>(v), s, s2, v2 != 0, static_cast<InstrOpInfoFlags>(v3));
				break;
			case CtorKind::pblendvb:
				instrInfo = new SimpleInstrInfo_pblendvb(s);
				break;
			case CtorKind::pclmulqdq:
				v = reader.ReadByte();
				instrInfo = new SimpleInstrInfo_pclmulqdq(s, FormatterConstants::GetPseudoOps(static_cast<PseudoOpsKind>(v)));
				break;
			case CtorKind::pops:
				v = reader.ReadByte();
				v2 = reader.ReadByte();
				if (v2 > 1)
				{
					throw InvalidOperationException();
				}
				instrInfo = new SimpleInstrInfo_pops(s, FormatterConstants::GetPseudoOps(static_cast<PseudoOpsKind>(v)), v2 != 0);
				break;
			case CtorKind::mem16:
				ca[0] = static_cast<char>(reader.ReadByte());
				s2 = AddSuffix(s, ca);
				ca[0] = 'w';
				s3 = AddSuffix(s, ca);
				instrInfo = new SimpleInstrInfo_mem16(s, s2, s3);
				break;
			case CtorKind::Reg32:
				instrInfo = new SimpleInstrInfo_Reg32(s);
				break;
			case CtorKind::sae:
				v = reader.ReadCompressedUInt32();
				instrInfo = new SimpleInstrInfo_sae(static_cast<std::int32_t>(v), s);
				break;
			case CtorKind::ST_STi:
				instrInfo = new SimpleInstrInfo_ST_STi(s);
				break;
			case CtorKind::STi_ST:
				v = reader.ReadByte();
				if (v > 1)
				{
					throw InvalidOperationException();
				}
				instrInfo = new SimpleInstrInfo_STi_ST(s, v != 0);
				break;
			case CtorKind::STIG1:
				v = reader.ReadByte();
				if (v > 1)
				{
					throw InvalidOperationException();
				}
				instrInfo = new SimpleInstrInfo_STIG1(s, v != 0);
				break;
			default:
				throw InvalidOperationException();
			}
			infos[i] = instrInfo;
			if (currentIndex >= 0)
			{
				reader.SetIndex(currentIndex);
			}
		}
		if (reader.GetCanRead())
		{
			throw InvalidOperationException();
		}
		return infos;
	}

